import React from "react";
import "./Nav.css";
import { Link } from "react-router-dom";

export default function Nav(props) {
  return (
    <nav>
      <ul>
        <li>
          <Link to={`/${props.page1}`}>{props.page1}</Link>
        </li>
        <li>
          <Link to={`/${props.page2}`}>{props.page2}</Link>
        </li>
      </ul>
    </nav>
  );
}
